window.bookSummaryJSON = "<p>Tanner O'Ryan is in desperate need of help. </p> <p>When her mother suddenly suggests they drive to Sumner, Georgia, to get assistance from her father, Cameron Wagner, she is more than floored. In her 23 years, she's never known who her father is, and now she has to put her trust in the man. Not only does she have to trust him, but an entire club full of men and women who live a life she didn't know anything about. </p> <p>She quickly realizes she needs more help than she originally thought. </p> <p>Contains mature themes. </p>"; 
